create table Customer(
                Id integer not null,
                FirstName varchar(100) not null,
                LastName varchar(100) not null,
                constraint pk_customer_id primary key (Id));

create table Station(
                Id integer not null,
                Name varchar(100) not null,
                constraint pk_station_id primary key (Id));

create table Connection(
                Id integer not null,
                FromStationId integer not null,
                ToStationId integer not null,
                TransportType integer not null,
                Duration integer not null,
                Cost decimal(10, 2) not null,
                constraint pk_connection_id primary key (Id),
                constraint fk_from_station_id foreign key (FromStationId) references Station(Id),
                constraint fk_to_station_id foreign key (ToStationId) references Station(Id));

create table Ticket(
                Id integer not null,
                ConnectionId integer not null,
                CustomerId integer not null,
                OneWay bit not null,
                constraint pk_ticket_id primary key (Id),
                constraint fk_connection_id foreign key (ConnectionId) references Connection(Id),
                constraint fk_customer_id foreign key (CustomerId) references Customer(Id));

create table Employee(
                Username varchar(100) not null,
                Password varchar(100) not null,
                CounterStationId integer not null,
                constraint pk_employee_username primary key (Username),
                constraint fk_counter_station_id foreign key (CounterStationId) references Station(Id));









